import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom'


const App: React.FC = () => {
  return (
      <Router>
        <Navbar />
        <Routes>
          <Route path='/customer' element={<Customer />} />
          <Route path='/lot' element={<Lot />} />
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </Router>
  )
};

export default App;
